    [],nt"revision_timestamp": "2015-09-27T02:08:59.840608",nt"name": "gravity-data-for-egypt",nt"isopen":
    false,nt"url": null,nt"notes": "The gravity station data (71 records) were
    gathered by various governmental organizations (and academia) using a variety of
    methods. This data base was received in March 1989. Principal gravity parameters
    include Free-air Anomalies and Simple Bouguer Anomalies (no terrain correction applied).
    The observed gravity values are referenced to the International Gravity Standardization
    Net 1971 (IGSN 71) and the gravity anomaly computation uses the Geodetic Reference
    System 1967 (GRS 67) theoretical gravity formula. The spatial resolution of the
    data is randomly distributed within the boundaries of Egypt.",nt"license_title":
